import "./Step.css"


const Step = () => {
    return (
        <div className="step">
        <div className="step_number_1">STEP 1</div>
        <div className="step__header">Connect Your Content</div>
        <div className="step__header_text">Bring all of your content together and get a Homepage that
automatically updates whenever you create anywhere online.</div>
        <button className="step__button_1">View Avaliable Sources</button>
        </div>
    )
}

export default Step;
